O presente curso tem como objetivo capacitar e atualizar os servidores da Jucer quanto aos procedimentos de planejamento, gestão e fiscalização de contratos públicos, com base nas diretrizes e exigências da Lei n° 14.133/2021, proporcionando:

Aperfeiçoamento técnico sobre as etapas do ciclo de contratação pública;

Compreensão dos instrumentos de gestão e fiscalização, com foco na eficiência e na conformidade legal;

Prevenção de falhas e responsabilizações administrativas, por meio da aplicação de boas práticas de governança e controle interno;

Desenvolvimento de competências práticas voltadas à execução e acompanhamento de contratos de terceirização de serviços, visando à mitigação de riscos e otimização dos resultados institucionais.
